<div id="t7_4" class="t s2_4">• All battery operated or electronic gadgets such as mobile phones, cameras, audio/video cassettes,</div>
<div id="t8_4" class="t s2_4">compact discs, Mp3 players, floppies, laptops, palmtops or portable music players</div>
<div id="t9_4" class="t s2_4">• All bags such as travel bags, back packs, briefcases, suitcases, leather, jute or cloth bags and zip folders</div>
<div id="ta_4" class="t s2_4">• Sealed envelopes or packages</div>
<div id="tb_4" class="t s2_4">• Any inflammable item such as matchboxes/ lighters/ fuel, etc.</div>
<div id="tc_4" class="t s2_4">• Any sharp objects such as scissors, pen knives or nail filers</div>
<div id="td_4" class="t s2_4">• Weapon or weapon like objects or explosive material of any kind</div>
<div id="te_4" class="t s2_4">Please note: There are no facilities at the visa application centre to store prohibited items. Applicants should</div>
